import EventsList from "../components/EventsList";

export const EventsPage = () => {
  return (
    <>
      <h1>Events</h1>
      <ul>
        {EventsList.map((event)=>(
            <li key={event.id}>{event.name}</li>
        ))}
      </ul>
    </>)
};
